function uploadfile(){var t=document.getElementById("projectFile"),i=new FormData,n;if(i.append("file",$("#projectFile")[0].files[0]),t.files.length>0)for(n=0;n<t.files.length;n++)i.append("file-"+n,t.files[n]);$.ajax({url:"/Projetos/UploadProject",type:"POST",data:i,processData:!1,contentType:!1,success:function(){alert("Projeto enviado com sucesso!")},error:function(){},complete:function(){}})}